	CardUtil.isOnTableuTop = function(card)
		{
		if (card.myState != Card.STATE_TABLEU)
			{
			return false;
			}

		var arr = Card.cardArray;
		var i = arr.length;
		while (i-- > 0)
			{
			var c = arr[i];
			if (c == card)
				{
				continue;
				}
			if (c.myState == Card.STATE_TABLEU)
				{
				if (c.tableuIdx == card.tableuIdx)
					{
					if (c.tableuPosition > card.tableuPosition)
						{
						return false;
						}
					}
				}
			}

		return true;
		};

